import React, { useState } from 'react';
import { Container, Row, Col, Button, ButtonGroup, Card} from 'react-bootstrap';
import ShowExpedients from './ShowExpedients';

const Expedients = (props) => {
  const [vista, setVista] = useState(true);
  const [expedientes , setExpedientes] = useState([
   {id: 1, nombre: "Agua azul"},
   {id: 2, nombre: "LA VOLCADA DEL OESTE"}
  ]);

  return (
    <Container>
        <Row>
            <Col>
                <h4 className="text-primary font-weight-bold mb-3 ml-2">
                    Expedientes
                </h4>   
            </Col>
        </Row>
        <Card>
            <Card.Body>
            	<Row>
                    <Col sm={4}>
                        <ButtonGroup>
                          <Button onClick={() => setVista(true)} variant="primary">Lista</Button>
                          <Button onClick={() => setVista(false)} variant="primary">Cuadricular</Button>
                        </ButtonGroup>
                    </Col>
            	</Row>
                <ShowExpedients expedientes={expedientes} vista={vista} />
            </Card.Body>
        </Card>
    </Container>
  )
}

export default Expedients;
